import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <Link to='/'>
                <h1>The Dojo Blog</h1>
            </Link>
            <div className="links"></div>
            <Link to="/">Home</Link>
            <Link to="/create">New Blog</Link>
        </nav>
    );
}

export default Navbar;
